import axios from 'axios';

export const initialState = {
    step: 1,
    dinnerName: '',
    dinnerStyle: '',
    option: [],
};



const reducer = (state=initialState, action) => {
    switch(action.type) {
        default:
            return state;
    }
};

export default reducer;
